import React from "react";

const Myheader = () => {
  return (
    <div className="container">
      <div className="row mt-4">
        <div class="col-lg-12">
          <div className=" text-primary">
            <ul class="list-group">
              <li class="list-group-item active text-primary">
                Profile Setting
              </li>
              <li class="list-group-item">
                <i className="fa fa-user"></i> Personal Details
              </li>
              <li class="list-group-item">Contact Details</li>
              <li class="list-group-item">Education Details</li>
              <li class="list-group-item">My Skills & Expeerience</li>
              <li class="list-group-item">My Resume</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Myheader;
